CREATE TABLE Daily_Stock_Fact
(
    Stock_Key  VARCHAR2(100) primary key,
    Company_Key    VARCHAR2(100),
    Currency_Key varchar2(510) ,
    Full_Date    VARCHAR2(100),
    Open_Price number,
    High_Price  number,
    Low_Price number,
    Close_Price number,
    Volume varchar2(50),
    Change_Pct varchar2(100)
);






